sys_variable_value.value:
(function execute(inputs, outputs) {
 var arryObj = [];
  var referenceIDList = inputs.referenceIDList.data;
  var output = [];
  var obj = {};
  for(var i = 0;i<referenceIDList.length;i++){
    obj = {};
    obj.name = referenceIDList[i].name;
    obj.label = referenceIDList[i].label;
  	output.push(obj);
  }
  outputs.reference_list = output;
})(inputs, outputs);

